<script type="text/javascript">
    const log = false;

    var routesCurrentlyDisplayedObject = [];    // array?

    var mymap = L.map('mapid', {
        // options can go in here
        zoomControl: true,
        attributionControl: false,
    }).setView(
        [31.708494,34.995529], // center is set here
        12);

    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 18,
    }).addTo(mymap);

    function displayMap(map) {
        const iterator = map.keys();
        var arr = Array.from(iterator);
        return arr;
        //return [firstValue, secondValue];

*/
    function forEachPrevMarker(prevMarker) {
        if (prevMarker) {
            //if (log)  console.log(prevMarker);
            prevMarker.removeFrom(mymap);
        }
    }

    /*
    // handle event
    // this function is called for each ServerSentEvent that arrives from the server.
    // In our case, the event.data is expected to be a JSON of the following form:
        {
            "timestamp": "2019-01-26T23:59:44.413",
            "description": "[line 228 v 4934531 oad 23:00 ea 00:07]",
            "agency": "15",
            "routeId": "11101",
            "shortName": "228",
            "serviceId": "9959394",
            "oad": "23:00",
            "vehicleId": "4934531",
            "estimatedArrival": "00:07",
            "gpsTimestamp": "23:59:59",
            "long": "32.16265869140625",
            "lat": "34.834739685058594"
        }
    */
    function doOnMessage(event) {
        // if (log) {
        //     console.log(event);
        //     //console.log(event.data);
        // }
        const msg = JSON.parse(event.data);
        const vehicle = msg.vehicleId;

        if (routeIdsShownOnMap.includes(msg.routeId)) {
            console.log(msg.routeId+'/'+msg.vehicleId);
            //if (msg.shortName.startsWith('417')) { //} || msg.shortName.startsWith('420')) {
            //if (msg.serviceId.startsWith('36209') || msg.serviceId.startsWith('354594')) {
            // line 417 // line 420
            if (mapVar.get(vehicle)) {		// map already contains vehicle
                mapVar.get(vehicle).prevMarkers.push(mapVar.get(vehicle).marker);	// add current marker to list of previous markers
                if (log) console.log('previous markers:' + mapVar.get(vehicle).prevMarkers.length);
                mapVar.get(vehicle).prevMarkers.forEach(forEachPrevMarker);
                msg.prevMarkers = mapVar.get(vehicle).prevMarkers;
            }
            else {
                msg.prevMarkers = new Array();
            }

            const marker = putMarkerOnMap(msg.long, msg.lat, msg.shortName, msg);
            if (marker) {
                if (log) console.log('put marker of vehicle ' + vehicle);
                msg.marker = marker;
            }
            mapVar.set(vehicle, msg);
        }
        else {
            counter = counter + 1;
            if (counter % 1000 == 0) {
                //if (log)
                console.log('.');
            }
        }

        // if (msg.vehicleId == "8769401") {
        //     positionOf8879701 = [msg.long, msg.lat]
        //     if (log) console.log('position of 8769401: ' + positionOf8879701)
        // }
        // if (msg.vehicleId == "520") {
        //     if (log) console.log('position of 520: ' + [msg.long, msg.lat])
        // }
        //if (log) console.log(displayMap(mapVar))

    const routeIdsShownOnMap = ['15540', '15541', // line 15
        '15440', '15441', '15442', '15443',		// line 18
        '15438', '15439',	// line 10
        '15494', '15495',	// line 14
        '15491',			// line 12
        '16211', '16212'	// line 7
    ]


    var source = new EventSource("http://localhost:3000/");



    //var source = new EventSource("http://localhost:3000/");
    var mapVar = new Map();
    var counter = 0 ;

    source.onmessage = doOnMessage;

            console.log(event);
        }
    };

    function hourFromTimestamp(timestamp) {
        let h = timestamp.split('T')[1];
        let hhmm = h.split(':')[0] + ':' + h.split(':')[1];
        return hhmm
    }

    function createTitle(msg) {
        const hour = hourFromTimestamp(msg.timestamp);
        let title = '' + hour + '   ' + msg.shortName + '\n' + msg.routeId + '   ' + msg.oad;
        return title;
    }

    /*
    retrieve from server the shape of this route
    and then apply the function f (if exists) on this shape.
    function f could be for example displayRouteOnMap()
     */
    function retrieveShapeByRouteId(routeId, f) {
        const url = 'http://localhost:8080/shape/' + routeId;

        var gtfsAPI = url;
        $.getJSON( gtfsAPI, {
            format: "json"
        })
            .fail(function( jqxhr, textStatus, error ) {
                var err = textStatus + ", " + error;
                console.log( "Request Failed: " + err );
            })
            .done(function( data ) {
                console.log('done');//, data=' + data);
                //displayRouteOnMap(data)
                if (f) {
                    f(data);
                }
            });
    }
    // function displayAllRoutes() {
    //     console.log('displaying all routes...');
    //
    //     for (const rid of mapRouteToShape.keys()) {
    //         displayRoute(rid);
    //         console.log('done');
	// 	}

	function displayRoute(routeId) {
        //let shape =
        retrieveShapeByRouteId(routeId, displayRouteOnMap);
        console.log('displaying route ' + routeId);// + '\n shape: ' + shape[0] + '\n ' + shape[1]);
        //displayRouteOnMap(shape);
    }
    function displayRouteOnMap(shape) {
        console.log('displaying shape...  (' + shape.length + ' points)');
        const polyline = L.polyline(shape, {color: 'red'}).addTo(mymap);
        console.log('polyline added to map');
        //mymap.fitBounds(polyline.getBounds());    // when uncommented, map moves when route is drawn, and we miss the mouseout event
        routesCurrentlyDisplayedObject.push(polyline);
    }

    function putMarkerOnMap(long, lat, shortName, msg) {
        if (long == 0 || lat == 0) {
            return;
        }
        const title = createTitle(msg);
        let iconUrl = 'icons/black-pin.svg';
        if (shortName.startsWith('417') && msg.routeId.startsWith('6660')) {
            iconUrl = 'icons/red-pin.svg';
        }
        return L.marker([long, lat],
            {	// marker options https://leafletjs.com/reference-1.4.0.html#marker-option
                title: title,
                opacity: 1.0,
                icon: L.icon({
                    iconUrl: iconUrl,
                    iconSize: [24, 24]
                })
            })
        // .bindTooltip('<p><b>' + "קו " + shortName + '</b> ' + 'יצא ב ' + msg.oad + '</p>',
        // 	//hourFromTimestamp(msg.timestamp) + '<br/>' + msg.routeId + '<br/>'
        //     {
        //         permanent: false,
        //         direction: 'left'
        //     })
            .addTo(mymap).on('mouseover', function (e) {
                //  displayAllRoutes();
                //alert( 'displaying route ' + msg.routeId + ' at ' + this.getLatLng());
                //alert(msg.routeId);
                //e.latlng;	//?

				console.log('mouseOver a bus of route ' + msg.routeId);
                // const shape = mapRouteToShape.get(msg.routeId);
				// console.log('found shape ');
                displayRoute(msg.routeId);
            })
            .on('mouseout', function(e) {
                console.log('mouse out, e=' + e);
                /*
                remove ALL the polyline from map when mouse is out of hovering over a pin (bus location)
                 */
                for (var i = 0, len = routesCurrentlyDisplayedObject.length; i < len; i++) {
                    routesCurrentlyDisplayedObject[i].remove();
                }
                });
    }
